eive+a+confirmation.+If+your+bid+fails+to+outbid+the+current+high+bidder%2C+you+will+be+offered+the+option+to+place+a+higher+bid.%3Cbr%3E%3Cbr%3E%0D%0A%0D%0AProxy+bidding+can+aid+your+chances+of+winning+an+auction+and+help+avoid+you+being+outbid+at+the+last+minute.+To+place+a+proxy+bid%2C+enter+in+the+maximum+price+you+are+willing+to+pay+for+the+item.+If+another+user+places+a+bid+on+the+same+auction%2C+automatic+bids+will+be+placed+on+your+behalf+in+accordance+with+your+maximum+bid+amount.+With+proxy+bidding+you+will+pay+the+lowest+possible+price+until+someone+else+places+a+higher+bid.%3Cbr%3E%3Cbr%3E%0D%0A%0D%0A%3Cb%3E%5C%22Buy+It+Now%5C%22+Auctions%3C%2Fb%3E%3Cbr%3E%3Cbr%3E%0D%0A%5C%22Buy+It+Now%5C%22+prices+are+set+by+the+seller.+If+you+agree+with+that+price%2C+you+can+click+on+the+%5C%22Buy+Now%5C%22+button+which+is+displayed+on+the+auction+details+page.+After+clicking+on+the+button%2C+you+will+be+re-directed+to+a+confirmation+page.%3Cbr%3E%3Cbr%3E%0D%0A%0D%0AOn+a+standard+auction%2C+that+auction+will+end+instantly+as+the+item+has+been+sold+via+%5C%22Buy+It+Now%5C%22.+On+a+Dutch+auction%2C+you+can+enter+the+amount+of+items+you+wish+to+buy+%28depending+the+quantity+available%29.+If+you+purchase+less+than+there+are+available+in+total%2C+the+auction+will+remain+open+with+the+number+of+items+left+available+after+you+have+purchased+the+amount+you+want.%3Cbr%3E%3Cbr%3E%0D%0A+%0D%0A%3Cb%3ERegistering%3C%2Fb%3E%3Cbr%3E%3Cbr%3E++%0D%0ARegistration+is+simple+and+only+takes+a+matter+minutes.+To+start+the+signup+process%2C+click+on+the+%5C%22register%5C%22+link+at+the+top+or+bottom+of+this+page.+Only+users+with+the+age+over+18+years+are+able+to+register.%3Cbr%3E%3Cbr%3E%0D%0A%0D%0AThe+next+step+is+to+fill+in+all+your+information%2C+failure+to+supply+all+the+required+information+will+result+in+an+error.%3Cbr%3E%3Cbr%3E+%0D%0A%0D%0AYour+account+will+be+activated+instantly%2C+if+there+is+no+signup+fee%2C+or+once+the+payment+has+been+confirmed+by+the+payment+gateway.%3Cbr%3E%3Cbr%3E+%0D%0A%0D%0A+%0D%0A%3Cb%3EMembers+Area%3C%2Fb%3E%3Cbr%3E%3Cbr%3E%0D%0A%0D%0AOnce+you+have+successfully+logged+in+using+the+login+forms+from+the+main+page+or+from+the+login+page+%28click+on+the+%5C%22login%5C%22+button+from+the+page+header%29%2C+you+will+be+redirected+to+the+members+area+page.+This+page+is+divided+into+several+tabs%3A%3Cbr%3E%3Cbr%3E%0D%0A%0D%0Aa.+My+Active+Auctions%3Cbr%3E%0D%0Ab.+Auction+Filters%3Cbr%3E%0D%0Ac.+My+Expired+Auctions%3Cbr%3E%0D%0A%0D%0Ad.+My+Info%3Cbr%3E%0D%0Ae.+Messaging%3Cbr%3E%0D%0Af.+My+Favorites%3Cbr%3E%0D%0Ag.+Feedback%3Cbr%3E%0D%0Ah.+Current+Bids%3Cbr%3E%3Cbr%3E%0D%0A%0D%0A%3C%21--%0D%0A%3Cb%3EDutch+Auctions%3C%2Fb%3E%3Cbr%3E%3Cbr%3E++%0D%0AOn+a+Dutch+Auction%2C+the+auctioneer+has+more+items+of+the+same+product+for+sale.+The+bidder+will+enter+a+maximum+bid+he+is+willing+to+pay+for+an+item%2C+and+the+number+of+items+he+wants+to+purchase.+The+highest+bidder%28s%29+will+receive+the+number+of+items+they+have+bid+on%2C+and+the+remaining+bidders+will+receive+the+number+of+items+still+available.+Buyers+are+able+to+bid+more+than+once+for+the+same+item.%3Cbr%3E%3Cbr%3E+%0D%0A--%3E%0D%0A+%0D%0A%3Cb%3EFeedback+System%3C%2Fb%3E%3Cbr%3E%3Cbr%3E++%0D%0A%0D%0AOnce+a+sale+has+been+processed%2C+both+the+seller+and+the+buyer+will+be+able+to+leave+feedbacks+for+each+other.+The+feedback+rating+is+from+one+point+to+five+points%2C+and+a+feedback+comment+can+also+be+left.+The+feedback+can+be+left+from+the+%5C%22Feedback%5C%22+tab+from+the+Members+Area.+The+feedback+can+only+be+left+once%2C+and+it+cannot+be+edited+afterwards.%3Cbr%3E%3Cbr%3E%0D%0A%0D%0AThe+site+admin+will+reserve+its+right+to+delete+malicious+or+untrue+feedbacks.%3Cbr%3E%3Cbr%3E+%0D%0A%0D%0A+%0D%0A%3Cb%3EItem+Watching%3C%2Fb%3E%3Cbr%3E%3Cbr%3E++%0D%0AThe+item+watch+features+lets+you+keep+a+close+eye+on+any+auction+without+having+to+place+a+bid+on+it.+This+feature+means+you+can+be+kept+up+to+date+on+how+an+auction+is+doing+and+prepares+you+to+place+a+winning+last+minute+bid.+You+can+watch+any+auction+by+clicking+on+the+%5C%22add+item+to+favorites%5C%22+link+on+any+auction+page.%3Cbr%3E%3Cbr%3E+%0D%0A+%0D%0A%3Cb%3EAuction+Filters%3C%2Fb%3E%3Cbr%3E%3Cbr%3E++%0D%0AThe+auction+watch+features+notifies+you+of+newly+listed+auctions+which+contain+%5C%22keywords%5C%22+you+have+chosen.+For+example%2C+if+you+are+looking+for+a+%5C%22website+template%5C%22%2C+you+could+enter+in+those+keywords+from+within+your+members+area.+Each+time+a+new+auction+is+listed+containing+the+term+%5C%22website+template%5C%22%2C+you+will+be+notified+via+this+website.+You+can+enter+in+as+many+keywords+as+you+like.%3Cbr%3E%3Cbr%3E+%0D%0A%3C%2Ftd%3E%0D%0A%3C%2Ftr%3E%0D%0A%3C%2Ftable%3E%0D%0A',0)
