, (83,'LOGIN PAGE TEMPLATE','WE\'VE PLACED SOME HTML AROUND THE MAINBODY TAG IN THIS TEMPLATE TO GIVE THE LOGIN PAGE A UNIQUE LOOK.',1,'','<html>\r\n<head>\r\n<title><MODULE_TITLE></title>\r\n<base href="http://@@SUBDOMAIN@@" />\r\n<<CSSSTYLESHEET>>\r\n<link href="geostyle.css" rel="stylesheet" type="text/css">\r\n\r\n<script language="JavaScript">\r\n	var showDateShort = 1;\r\n	var showDate= 2;\r\n	var showDateTime= 3;\r\n	var showTime= 4;\r\n\r\n function ShowDateTime(dateStyle)\r\n	{\r\n		var today = new Date();\r\n		var dStr = "";\r\n		\r\n		switch (dateStyle)\r\n		{\r\n			case showDateShort:\r\n				dStr = today.toDateString();\r\n				break;\r\n			case showDateTime:\r\n				dStr = today.toLocaleString();\r\n break;\r\n			case showTime:\r\n				dStr = today.toLocaleTimeString();\r\n				break;\r\n			case showDate:\r\n			default:\r\n				dStr = today.toLocaleDateString();\r\n				break;\r\n		}\r\n document.write(dStr);\r\n	}\r\n</script>\r\n<meta http-equiv="Content-Type" content="text/html; charset=iso-8859-1">\r\n</head>\r\n<body>\r\n<div class="bodytable">\r\n<!-- BEGIN TOP MENU BAR - CHANGE THIS HTML IN THE MODULES AREA OF THE ADMIN -->\r\n<<LOGGED_IN_OUT_HTML_2>>\r\n<!-- END TOP MENU BAR -->\r\n\r\n<!-- BEGIN HEADER - CHANGE THIS HTML IN THE MODULES AREA OF THE ADMIN -->\r\n<<LOGGED_IN_OUT_HTML>>\r\n<!-- END HEADER -->\r\n\r\n<!-- BEGIN SUBMENU BAR - CHANGE THIS HTML IN THE MODULES AREA OF THE ADMIN -->\r\n<<LOGGED_IN_OUT_HTML_3>>\r\n<!-- END SUBMENU BAR -->\r\n\r\n  <!# MAIN 3 COLUMN BODY TABLE START-->\r\n   <table class="maintable">\r\n    <tr valign="top">\r\n    <td class="centercolumn">\r\n    <!# CENTER COLUMN - MAIN TABLE START-->\r\n\r\n<div align="center">\r\n<table width="600">\r\n <tr valign="top">\r\n  <td style="font-size:12px;">\r\n<h1>Have an account?</h1>\r\nYou must sign in to view vehicles listed on this site.<br>\r\n<div align="center"><table border="0"><tr><td>\r\n\r\n<table cellpadding="0" cellspacing="0" border="0" style="border-collapse:col