, (149,'Storefront Default Template','Mimmicks the original default template for classauction software.',1,'','<html>\r\n<head>\r\n<base href="http://@@SUBDOMAIN@@" />\r\n\r\n<script language=\'Javascript\'>\r\n            var prev_order = null;\r\n \r\n            function switch_order(original_order, new_order, element_length, subject_name)\r\n            {\r\n                for(x = 0; x < element_length; x++)\r\n                {\r\n                    var element_id = \'order_\'+(x+1);\r\n if(document.getElementById(element_id).value == new_order)\r\n {\r\n                        document.getElementById(element_id).value = original_order;\r\n                    }\r\n                }\r\n document.getElementById(subject_name).value = new_order;\r\n prev_order = new_order;\r\n            }\r\n </script>\r\n\r\n<script LANGUAGE="JavaScript" type="text/javascript">\r\nvar isDrag = false;\r\nvar dragDOMElement;\r\nvar iniX,iniY;\r\nvar objX,objY;\r\nfunction getCookie(sName)\r\n{\r\n    var aCookie = document.cookie.split("; ");\r\n    for (var i=0; i < aCookie.length; i++)\r\n    {\r\n        var aCrumb = aCookie[i].split("=");\r\n        if (sName == aCrumb[0]) \r\n            return unescape(aCrumb[1]);\r\n    }\r\n    return null;\r\n}\r\nfunction setManager()\r\n{\r\n    dragDOMElement = document.getElementById(\'container\');\r\n\r\n        //set position\r\n    dragDOMElement.style.left = getCookie(\'managerX\');\r\n dragDOMElement.style.top = getCookie(\'managerY\');\r\n if(dragDOMElement.offsetLeft<0)\r\n dragDOMElement.style.left="0px";\r\n if(dragDOMElement.offsetTop<0)\r\n dragDOMElement.style.top="0px";\r\n\r\n        //unhide\r\n dragDOMElement.style.display = \'\';\r\n\r\n        //save cookies\r\n    document.cookie = "managerX="+getCookie(\'managerX\');\r\n document.cookie = "managerY="+getCookie(\'managerY\');\r\n}\r\nfunction grab(e)\r\n{\r\n    if(!e)\r\n        e=event;\r\n isDrag=true;\r\n    iniX=e.clientX;\r\n    iniY=e.clientY;\r\n objX=parseInt(dragDOMElement.style.left+0,10);\r\n objY=parseInt(dragDOMElement.style.top+0,10);\r\n document.onmousemove=drag;\r\n    return false;\r\n}\r\nfunction drag(e)\r\n{\r\n    if(isDrag)\r\n    {\r\n        if(!e)\r\n e=event;\r\n        dragDOMElement.style.left = objX+e.clientX-iniX;\r\n        dragDOMElement.style.top = objY+e.clientY-iniY;\r\n    }\r\n    return false;\r\n}\r\nfunction drop(e)\r\n{\r\n    isDrag = false;\r\n if(dragDOMElement.offsetLeft<0)\r\n dragDOMElement.style.left="0px";\r\n if(dragDOMElement.offsetTop<0)\r\n dragDOMElement.style.top="0px";\r\n    document.cookie = "managerX="+dragDOMElement.style.left;\r\n document.cookie = "managerY="+dragDOMElement.style.top;\r\n    return false;\r\n}\r\ndisplayContent = true;\r\nfunction toggleContent()\r\n{\r\n    displaySetting = displayContent ? \'none\' : \'\';\r\n document.getElementById(\'content\').style.display = displaySetting;\r\n    displayContent = displayContent ?  false : true;\r\n}\r\n</script>\r\n\r\n<link href="geostyle.css" rel="stylesheet" type="text/css">\r\n<link href="storefront.css" rel="stylesheet" type="text/css">\r\n<title>Storefronts</title>\r\n\r\n<link href="geostyle.css" rel="stylesheet" type="text/css">\r\n</head>\r\n<body onload=\'javascript:setManager();\' onMouseUp=\'javascript: drop()\'>\r\n\r\n<table class="bodytable">\r\n <tr>\r\n  <td>\r\n   <table border=0 cellpadding=0 cellspacing=0 width=\'100%\'><tr><td><a href=\'index.php\'>\r\n <img src="images/header_a.gif" border=0></a></td>\r\n <td align="center">(!STOREFRONT_LOGO!)</td></tr></table>\r\n </td>\r\n </tr>\r\n <tr>\r\n\r\n  <td class="submenu" align="right">(!STOREFRONT_WELCOME_NOTE!)&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n </tr>\r\n <tr valign="top">\r\n  <td>\r\n   <table class="maintable">\r\n    <tr valign="top">\r\n <td class="leftcolumn">\r\n<!-- BEIGN LEFT COLUMN -->\r\n(!STOREFRONT_CATEGORIES MENU_TITLE="<table cellpadding=\'0\' cellspacing=\'0\' border=\'0\' style=\'border-collapse:collapse;\' width=\'150\'